They say love heals all wounds and in Tamara’s case it was the love of two strangers who finally helped heal her heart and opioid addiction. 

This scene was added later, script the day before, and ended up being one of my favorites because she’s finally free (callback to ep #610), albeit a long road to recovery. Very thankful to get to work with @johnnygray5 on this; for his direction, his trust and the space to explore.

@911onfox

how I feel before and after a really fun book 📚 (and a really great glam team). anyone else with an #agathacristie novel on their bedside table?

